import React from 'react'
import { Outlet } from 'react-router-dom';
import WaitForAdminConfirmation from './WaitForAdminConfirmation';

const Home = ({id}) => {
  return (
    <div>
        {props.code ? <Outlet code={props.code} id={id}/> : <WaitForAdminConfirmation/>}
    </div>
  )
}

export default Home
